    "# Import necessary libraries\n",
    "import torch\n",
    "from torchvision import transforms\n",
    "from torchvision.datasets import ImageFolder\n",
    "from torch.utils.data import DataLoader, Dataset\n",
    "\n",
    "# Define a function to convert color images to grayscale\n",
    "def grayscale(image):\n",
    "    grayscale_image = torch.mean(image, dim=0, keepdim=True)\n",
    "    return grayscale_image\n",
    "\n",
    "# Create a custom dataset to store grayscale versions of images\n",
    "class GrayscaleImageDataset(Dataset):\n",
    "    def __init__(self, dataset):\n",
    "        self.dataset = dataset\n",
    "\n",
    "    def __len__(self):\n",
    "        return len(self.dataset)\n",
    "\n",
    "    def __getitem__(self, index):\n",
    "        # Retrieve an image and its label from the original dataset\n",
    "        image, label = self.dataset[index]\n",
    "\n",
    "        # Convert the image to grayscale\n",
    "        grayscale_image = grayscale(image)\n",
    "\n",
    "        # Return the grayscale image along with its label\n",
    "        return grayscale_image, label\n",
    "\n",
    "# Load the original image dataset in 'rgb_imagedataset' folder and convert it to PyTorch tensors\n",
    "train_dataset = ImageFolder(root='rgb_imagedataset', transform=transforms.ToTensor())\n",
    "\n",
    "# Create a new dataset containing grayscale versions of the images\n",
    "grayscale_dataset = GrayscaleImageDataset(train_dataset)\n",
    "\n",
    "# Save the grayscale image dataset as 'grayscale.pt' using PyTorch's serialization\n",
    "torch.save(grayscale_dataset, 'grayscale.pt')"
