    "import os  # Import the os library for file and directory operations\n",
    "import pandas as pd  # Import the pandas library for data manipulation\n",
    "import cv2  # Import the OpenCV library for image processing\n",
    "\n",
    "# Step 1: Image Preprocessing\n",
    "def preprocess_image(image_path):\n",
    "    img = cv2.imread(image_path, cv2.IMREAD_GRAYSCALE)\n",
    "    # You can perform any necessary preprocessing here, such as resizing.\n",
    "    return img\n",
    "\n",
    "# Step 2: Define Parameters\n",
    "def calculate_parameters(image):\n",
    "    mean_intensity = image.mean()\n",
    "    std_deviation = image.std()\n",
    "    return mean_intensity, std_deviation\n",
    "\n",
    "# Process a folder and save the data to an Excel file\n",
    "def process_folder(folder_path, output_filename):\n",
    "    # Step 3: Create a Spreadsheet\n",
    "    data = []\n",
    "\n",
    "    # List all image files in the folder\n",
    "    image_paths = [os.path.join(folder_path, filename) for filename in os.listdir(folder_path) if filename.endswith('.jpg')]\n",
    "\n",
    "    for i, image_path in enumerate(image_paths):\n",
    "        image = preprocess_image(image_path)\n",
    "        mean_intensity, std_deviation = calculate_parameters(image)\n",
    "        data.append([i + 1, mean_intensity, std_deviation])\n",
    "\n",
    "    # Step 4: Populate the Spreadsheet\n",
    "    df = pd.DataFrame(data, columns=[\"Image ID\", \"Mean Intensity\", \"Standard Deviation\"])\n",
    "\n",
    "    # Step 5: Save to Excel\n",
    "    df.to_excel(output_filename, index=False)\n",
    "\n",
    "    print(f\"Data saved to {output_filename}\")  # Display a message indicating that the data has been saved\n",
